import React from 'react';
import styled from 'styled-components';
import { Element } from 'react-scroll';

const About = () => {
  return (
    <Element id='about' name='about' className="element">
      <div> I'm Heather Reaper blah blah</div>
    </Element>
  )
}

export default About;
